	public String pointInPolygon(String lngLat) {
		
		try {

		/*
		 * Get the county polygon from a stub for now
		 */
		//Polygon countyPolygon = stub_getSaltLakeCountyPolygon();
		Polygon countyPolygon = getSaltLakeCountyPolygon();
		
		/*
		 * Create a point from incoming lngLat string
		 */
		String[] coords = lngLat.split( ",\\s*" ); // split on commas
		double lat = Double.parseDouble(coords[0]);
		double lng = Double.parseDouble(coords[1]);
		Coordinate coord = new Coordinate(lat, lng);
		Point point = gf.createPoint( coord );
		
		/*
		 * Now use JTS to determine point-in-polygon relationship
		 */
		Boolean pointIsWithinPolygon = countyPolygon.contains(point);
		
		String geoGreeting = "Sorry, you didn't click in Salt Lake County. Try again.";
		if( pointIsWithinPolygon )
		{
			geoGreeting = "Congratulations. You clicked within the boundary of Salt Lake County.";
		}
		
		log.info(geoGreeting);
		
		return geoGreeting;
		
		} catch (Exception e)
		{
			e.printStackTrace();
			return e.getLocalizedMessage();
		}

	}

	public String polygonInPolygon(String bbox) {

		try {

			/*
			 * Get the county polygon from a stub for now
			 */
			//Polygon countyPolygon = stub_getSaltLakeCountyPolygon();
			Polygon countyPolygon = getSaltLakeCountyPolygon();
			
			/*
			 * Wrap incoming bbox in POLYGON((bbox))
			 */
			String bboxWKT = "POLYGON(("+bbox+"))";
			WKTReader reader = new WKTReader( gf );
			Polygon mapBoundingBox = (Polygon) reader.read(bboxWKT);
			
			/*
			 * Now use JTS to determine polygon-in-polygon relationship
			 */
			Boolean mapBoundsWithinPolygon = countyPolygon.contains(mapBoundingBox);
			
			String geoGreeting = "The map bounds expand beyond the boundary of Salt Lake County.";
			if( mapBoundsWithinPolygon )
			{
				geoGreeting = "The map bounds lay within the boundary of Salt Lake County.";
			}
			
			log.info(geoGreeting);
			
			return geoGreeting;
			
			} catch (Exception e)
			{
				e.printStackTrace();
				return e.getLocalizedMessage();
			}
			
	}
	
