	private Polygon stub_getSaltLakeCountyPolygon()
	{
		Polygon countyPolygon = null;
		try {

			// set up the JTS bits
			gf = new GeometryFactory();
			WKTReader reader = new WKTReader( gf );
			countyPolygon = (Polygon) reader.read(SALTLAKECOUNTY_WKT);

		} catch (ParseException e) {
			e.printStackTrace();
		}
		
		return countyPolygon;

		
	}
	
	private Polygon getSaltLakeCountyPolygon() {
		
		PersistenceManager pm = PMF.get().getPersistenceManager();
		String query = "SELECT FROM org.emcode.samples.giscloud.server.County WHERE name == 'SALT LAKE'";
		List<County> counties = (List<County>) pm.newQuery(query).execute();
		
		// get it out of lazy state
		counties.size();
		
		if(counties.isEmpty())
		{
			// create a County and insert it for demo
			County county = new County();
			county.setName("SALT LAKE");
			ArrayList<String> tracts = new ArrayList<String>();
			tracts.add("49035104800");
			county.setTracts(tracts);
			Text wktText = new Text(SALTLAKECOUNTY_WKT);
			county.setWkt(wktText);
			
			// save it
	        try {
	            pm.makePersistent(county);
	        } finally {
	            pm.close();
	        }

			// now get another handle on the pm and make the same query again
			pm = PMF.get().getPersistenceManager();
			counties = (List<County>) pm.newQuery(query).execute();

		} else {
			log.info("County was retrieved from datastore first time around");
		}
		
		// get out of lazy state
		counties.size();
		
		County fetched = counties.get(0);
		
		// make a Polygon from the WKT
		Text wktText = fetched.getWkt();
		String wkt = wktText.getValue();
		
		Polygon countyPolygon = null;
		try {

			// set up the JTS bits
			gf = new GeometryFactory();
			WKTReader reader = new WKTReader( gf );
			countyPolygon = (Polygon) reader.read(wkt);

		} catch (ParseException e) {
			e.printStackTrace();
		}
		
		return countyPolygon;
		
		
	}
